{
  "ubx_message_extraction": {
    "message_name": "UBX-NAV-GEOFENCE",
    "message_class": "0x01",
    "message_id": "0x39",
    "message_type": "periodic_polled",
    "description": "This message outputs the evaluated states of all configured geofences for the current epoch's position. See section Geofencing in the integration manual for feature details.",
    "payload_length": {
      "variable": {
        "base": 8,
        "formula": "8 + numFences*2"
      }
    },
    "fields": [
      {
        "byte_offset": 0,
        "data_type": "U4",
        "name": "iTOW",
        "unit": "ms",
        "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
      },
      {
        "byte_offset": 4,
        "data_type": "U1",
        "name": "version",
        "fixed_value": 0,
        "description": "Message version (0x00 for this version)"
      },
      {
        "byte_offset": 5,
        "data_type": "U1",
        "name": "status",
        "description": "Geofencing status\n0 - Geofencing not available or not reliable\n1 - Geofencing active"
      },
      {
        "byte_offset": 6,
        "data_type": "U1",
        "name": "numFences",
        "description": "Number of geofences"
      },
      {
        "byte_offset": 7,
        "data_type": "U1",
        "name": "combState",
        "description": "Combined (logical OR) state of all geofences\n0- Unknown\n1 - Inside\n2 - Outside"
      },
      {
        "byte_offset": 8,
        "is_repeated": true,
        "name": "geofences",
        "count_field": "numFences",
        "fields": [
          {
            "byte_offset": 0,
            "data_type": "U1",
            "name": "state",
            "description": "Geofence state\n0 - Unknown\n1 - Inside\n2 - Outside"
          },
          {
            "byte_offset": 1,
            "data_type": "U1",
            "name": "id",
            "description": "Geofence ID (0 = not available)"
          }
        ]
      }
    ]
  }
}
